import React from 'react'
import { Link } from 'react-router-dom'
import styled from "styled-components"
function Navbar({user}){
  console.log(user);
  const logout=()=>{

  }
    return (
        <Nav>
        <Logo>
       <Link className='link' to="/"> AUTH</Link>
        </Logo>
        
        {
          (user==true)? ( 
       <ul>
     <li> 
     <img src="./images/d.png"></img>
     </li> 
     <li>{user.d}</li> 
     <li onClick={logout}>Logout</li>    
       </ul>
        ): (
        <Link className='link' to="/login">Login</Link>

       )
        }
        </Nav>
        
    )
}

export default Navbar
const Nav=styled.div`
height:50px;

width:100 vw;

background-color:rgba(102,16,83,0.698);
color:white;
display:flex;
align-items:center;
justify-content:space-between;
ul{
  display:flex;
list-style:none;
align-items:center;
cursor:pointer;
  li{
img{
  width:50px;
  height:50px;
  border-radius:50%;

}

    padding:5px 30px;
    text-decoration:none;
  }
  
}

`
const Logo=styled.span`

font-size:20px;
margin-left:20px;
`
